import React from 'react';
import menuItems from "../utils/MainMenuItems";
import Menu from "./MainNavBar/index";

function renderMenuItems(){
    return (
        <div>
            {menuItems.map(item => (
                <Menu 
                    path={item.path}
                    href={item.href}
                    title={item.title}
                />
            ))}
        </div>
    )
}
export default renderMenuItems;
